INSERT INTO explanations VALUES (56, 'The dream of opportunity for all people has not come true for everyone in America, but its promise exists for all who come to our shores - that includes nearly seven million American Muslims in our country today who enjoy incomes and education that are higher than average. The sixth issue that I want to address is women''s rights.
INSERT INTO explanations VALUES (57, 'His eyes gave more light to us than our battle-lanterns. Black and impassive guns, and litter of powder-parcels, and the strong scent, The pilot seizes the king-pin, he heaves down with a strong arm, Man or woman! I might tell how I like you, but cannot, The souls moving along…are they invisible while the least atom of the stones is visible?
INSERT INTO explanations VALUES (53, 'According to The Brookings Institution, the Boston Metropolitan Statistical Area (MSA) ranks eighth out of the top 100 largest MSA’s in the US for number of clean jobs in 2010. While the clean jobs sector has shown consistent growth in the Boston MSA since 2003, its growth has been outpaced by other MSA’s and the US overall, and its share of clean jobs in the top 100 MSA’s and in the US has steadily declined since 2003. Compared to the US, the clean jobs in the Boston MSA are geared toward a more educated labor pool. A higher share of jobs in the Boston MSA, compared to the top 100 MSA’s and the US overall, are occupied by employees with a bachelor’s degree or higher. Though nearly 64% of all Boston MSA clean jobs are considered green collar, or occupations paying mid-level wages, the Boston MSA ranks rank 80th in green collar jobs share out of the top 100 MSA’s.
INSERT INTO explanations VALUES (60, '', 21, 'Indicator', '2014-02-11 16:19:16.423915', '2014-02-11 16:19:16.423915');
INSERT INTO explanations VALUES (54, 'Even within this more narrow definition, three sub-classes of workers stand out. The first includes workers involved in the direct production of cultural goods, such as lithographers, screen printers, jewelers, and musical instrument manufacturers. The second group involves the distribution of goods, such as book stores, museums, art dealers, and one-hour photofinishing. The third category involves the production and distribution of intellectual property. Workers in this category include book publishers, architects and graphic designers, and advertising agencies and media outlets, such as newspaper and magazine publishers.
INSERT INTO explanations VALUES (3, '', 208, 'Indicator', '2014-02-11 20:35:02.840545', '2014-02-11 20:35:02.840545');
INSERT INTO explanations VALUES (4, 'The region has made virtually no progress since 2000 in closing racial and ethnic educational attainment gaps. Blacks and Hispanics are 23 and 33 percentage points, respectively, below Whites; in 2000, they were 21 and 30 points below Whites. Within racial and ethnic groups, attainment diverges depending on spatial location. For example, educational attainment for Asians living in Regional Urban Centers is 36 percentage points below Asians living in Suburbs, and 7 percentage points below Blacks or Hispanics living in Suburbs. College attainment rates are relatively consistent across community types, with the exception of Regional Urban Centers, which are 16 points below the regional average. Generally, residents of suburban communities have the highest rates of college degree attainment, although for Whites, the rate is highest in Inner Core communities. ', 209, 'Indicator', '2014-02-17 22:00:57.722285', '2014-02-17 22:00:57.722285');
INSERT INTO explanations VALUES (2, 'Across Metro Boston, educational attainment is on the rise. Today, 54% of our working age adults have a 2- or 4-year college degree, a 5 percentage point increase since 2000. Across all races, ethnicities, and community types, more adults are graduating high school and getting college degrees. Blacks and Hispanics, especially those living in suburban areas, have shown significant increases in college degree attainment. Only Asians living in Suburbs did not gain ground in college degree attainment. But even without gains, they remain the most highly college educated group in the region. College attainment rates are relatively consistent across community types, with the exception of Regional Urban Centers, which are 16 percentage points below the regional average.', 207, 'Indicator', '2014-02-11 20:31:02.211435', '2014-02-17 22:10:35.054359');
INSERT INTO explanations VALUES (5, 'Across the region, 92% of working age adults have a have a high school diploma. This is a 3 point improvement since 2000.  The most significant gains in are among Hispanics in the region, especially those in Regional Urban Centers, where the percentage of working age Hispanic adults without a high school diploma has dropped 13 points since 2000. Despite these gains, Hispanic adults have the lowest rate of high school degree attainment in the region.', 210, 'Indicator', '2014-02-17 22:16:48.553321', '2014-02-18 16:13:47.799889');
