INSERT INTO goals VALUES (30, 30, 'Efficient, well-funded municipalities', 3, '2014-02-04 16:13:09.448663', '2014-02-04 16:15:49.49035', 'Municipalities will operate efficiently and will have adequate funding with less reliance on the property tax .');
INSERT INTO goals VALUES (31, 31, 'Civic Engagement', 3, '2014-02-04 16:13:09.45164', '2014-02-04 16:15:49.564153', 'The region’s residents—including youth, seniors, and immigrants—will be well-informed and engaged in civic life & community planning.');
INSERT INTO goals VALUES (32, 32, 'Active seniors', 3, '2014-02-04 16:13:09.454737', '2014-02-04 16:15:49.574458', 'Seniors will remain active members of their communities.');
INSERT INTO goals VALUES (27, 27, 'After-school and youth programs', 3, '2014-02-04 16:13:09.436531', '2014-02-04 16:15:49.577701', 'Children and youth will have access to a strong system of early education programs, after-school programs, teen centers, and youth organizations.');
INSERT INTO goals VALUES (28, 28, 'High-quality public schools', 3, '2014-02-04 16:13:09.442432', '2014-02-04 16:15:49.581845', 'Public schools will provide a high-quality education for all students, not only in the fundamentals, but also in areas like health education, physical education, art, music, civics, and science.');
INSERT INTO goals VALUES (29, 29, 'More high school graduates', 3, '2014-02-04 16:13:09.44544', '2014-02-04 16:15:49.586476', 'More students will graduate from high school and go on to college or career training opportunities.');
INSERT INTO goals VALUES (23, 23, 'Access to parks and playgrounds', 3, '2014-02-04 16:13:09.419705', '2014-02-04 16:15:49.64412', 'All neighborhoods will have adequate access to safe and well-maintained parks, community gardens, and appropriate play spaces for children and youth.');
INSERT INTO goals VALUES (22, 22, 'No disparity in pollutant exposure', 3, '2014-02-04 16:13:09.393517', '2014-02-04 16:15:49.64812', 'Urban and minority residents will not be disproportionately exposed to pollutants and poor air quality.');
INSERT INTO goals VALUES (24, 24, 'Access to healthy food', 3, '2014-02-04 16:13:09.425135', '2014-02-04 16:15:49.656328', 'Residents in all communities and of all incomes will have access to affordable, healthy food.');
INSERT INTO goals VALUES (25, 25, 'More physical activity', 3, '2014-02-04 16:13:09.429292', '2014-02-04 16:15:49.662204', 'Most residents will build regular physical activity into their daily lives.');
INSERT INTO goals VALUES (26, 26, 'Affordable healthcare', 3, '2014-02-04 16:13:09.432862', '2014-02-04 16:15:49.666238', 'All residents will have access to affordable healthcare');
INSERT INTO goals VALUES (21, 21, 'Safe Communities', 3, '2014-02-04 16:13:09.390546', '2014-02-04 16:15:49.670191', 'All communities will be safe, including areas currently afflicted by high rates of violent crime.');
INSERT INTO goals VALUES (56, 56, 'Fewer greenhouse gas emissions', 6, '2014-02-04 16:13:09.569566', '2014-02-04 16:15:49.676202', 'The region will be a national leader in reducing greenhouse gas emissions');
INSERT INTO goals VALUES (57, 57, 'Decreasing energy use', 6, '2014-02-04 16:13:09.572898', '2014-02-04 16:15:49.727691', 'The region will use progressively less energy for electricity, heating, cooling, and transportation');
INSERT INTO goals VALUES (58, 58, 'Less solid waste', 6, '2014-02-04 16:13:09.576015', '2014-02-04 16:15:49.753793', 'The region will produce less solid waste, and more of that waste will be recycled or composted');
INSERT INTO goals VALUES (59, 59, 'Less energy use', 6, '2014-02-04 16:13:09.57947', '2014-02-04 16:15:49.757318', 'The region will produce more renewable energy and will obtain more of its energy from renewable sources');
INSERT INTO goals VALUES (60, 60, 'Improving air quality', 6, '2014-02-04 16:13:09.58296', '2014-02-04 16:15:49.810825', 'The region will have better air quality, both indoors and out');
INSERT INTO goals VALUES (61, 61, 'Sustainably managed water resources', 6, '2014-02-04 16:13:09.586213', '2014-02-04 16:15:49.815491', 'Water resources will be carefully budgeted and sustainably managed so that clean water is available for appropriate uses and development');
INSERT INTO goals VALUES (62, 62, 'Clean and healthy bodies of water', 6, '2014-02-04 16:13:09.589525', '2014-02-04 16:15:49.827074', 'The region''s rivers, streams, lakes, and ponds will have sufficient clean water to support healthy populations of native fish and other species, as well as recreational use.');
INSERT INTO goals VALUES (63, 63, 'More and healthier wetlands', 6, '2014-02-04 16:13:09.592759', '2014-02-04 16:15:49.833887', 'The ecological condition of wetlands will improve, and fewer wetlands will be lost to development');
INSERT INTO goals VALUES (44, 44, 'Expanded transit system', 5, '2014-02-04 16:13:09.502086', '2014-02-04 16:15:49.898537', 'An expanded transit system will provide better service to both urban and suburban areas, linking more homes and jobs.');
INSERT INTO goals VALUES (45, 45, 'Increasing transit ridership', 5, '2014-02-04 16:13:09.507012', '2014-02-04 16:15:49.903135', 'More people will use transit for work and personal service');
INSERT INTO goals VALUES (46, 46, 'More options for commuters', 5, '2014-02-04 16:13:09.510566', '2014-02-04 16:15:49.910406', 'Commuters will have more options to avoid congestion');
INSERT INTO goals VALUES (48, 48, 'Less driving', 5, '2014-02-04 16:13:09.517397', '2014-02-04 16:15:49.924627', 'The average person will drive fewer miles every day');
INSERT INTO goals VALUES (50, 50, 'Better transportation for the disabled', 5, '2014-02-04 16:13:09.524232', '2014-02-04 16:15:49.991082', 'People with disabilities will find it easier to get around the region');
INSERT INTO goals VALUES (53, 53, 'Efficient project construction', 5, '2014-02-04 16:13:09.558921', '2014-02-04 16:15:50.072321', 'Transportation projects will be designed and built quickly and cost effectively');
INSERT INTO goals VALUES (54, 54, 'Safe roads and bridges', 5, '2014-02-04 16:13:09.56251', '2014-02-04 16:15:50.076826', 'Roads, bridges, and railways will be safe and well maintained');
INSERT INTO goals VALUES (14, 14, 'More moderately priced housing', 2, '2014-02-04 16:13:09.369208', '2014-02-04 16:15:50.09338', 'An increasing share of housing in each municipality will be affordable to working families and fixed income seniors.');
INSERT INTO goals VALUES (16, 16, 'Increased affordable housing production', 2, '2014-02-04 16:13:09.376653', '2014-02-04 16:15:50.158957', 'Low-income households will be able to find affordable, adequate, conveniently located  housing and avoid displacement.');
INSERT INTO goals VALUES (19, 19, 'Accessible housing', 2, '2014-02-04 16:13:09.384311', '2014-02-04 16:15:50.22842', 'Persons with physical or mental disabilities will be able to find housing that meets their needs in terms of design, services, and affordability.');
INSERT INTO goals VALUES (43, 43, 'Strong arts and culture sector', 4, '2014-02-04 16:13:09.498737', '2014-02-04 16:15:50.242509', 'More people will take advantage of the region''s artistic and cultural resources');
INSERT INTO goals VALUES (35, 35, 'Robust small business sector', 4, '2014-02-04 16:13:09.465174', '2014-02-04 16:15:50.309413', 'Small business owners and entrepreneurs will play a major role in the region''s economy and innovation');
INSERT INTO goals VALUES (37, 37, 'Strong supply of skilled workers', 4, '2014-02-04 16:13:09.473222', '2014-02-04 16:15:50.315086', 'A strong supply of educated and skilled workers of all ages will encourage business to locate and expand here');
INSERT INTO goals VALUES (39, 39, 'Higher labor force participation rates', 4, '2014-02-04 16:13:09.481051', '2014-02-04 16:15:50.326793', 'More workers will participate in the labor force, earning a living wage through secure employment');
INSERT INTO goals VALUES (40, 40, 'Less poverty', 4, '2014-02-04 16:13:09.484627', '2014-02-04 16:15:50.331356', 'Fewer of the region''s residents will live in poverty');
INSERT INTO goals VALUES (6, 6, 'High quality design', 1, '2014-02-04 16:13:09.3501', '2014-02-04 16:15:50.39777', 'High quality design will help compact development enhance the region’s character and livability.');
INSERT INTO goals VALUES (8, 8, 'Historic preservation', 1, '2014-02-04 16:13:09.354783', '2014-02-04 16:15:50.401866', 'Historic resources will be preserved and enhanced.');
INSERT INTO goals VALUES (10, 10, 'Informed, proactive planning', 1, '2014-02-04 16:13:09.359541', '2014-02-04 16:15:50.413875', 'Growth in the region will be guided by informed, inclusive, and proactive planning.');
INSERT INTO goals VALUES (9, 9, 'Green spaces and farms', 1, '2014-02-04 16:13:09.357104', '2014-02-04 16:15:50.429005', 'The region’s landscape will retain its distinctive green spaces and working farms.');
INSERT INTO goals VALUES (2, 2, 'Reuse of land and buildings', 1, '2014-02-04 16:13:09.339452', '2014-02-04 16:15:50.494983', 'Most new growth will occur through reuse of previously developed land and buildings.');
INSERT INTO goals VALUES (4, 4, 'Growth in town and village centers', 1, '2014-02-04 16:13:09.345052', '2014-02-04 16:15:50.500135', 'In suburban municipalities, most new growth will occur near town and village centers.');
INSERT INTO goals VALUES (64, 64, 'A biodiverse region', 6, '2014-02-04 16:13:09.596164', '2014-02-04 16:15:49.836524', 'The region will retain its biodiversity, and will have healthy populations of native plants and animals, and fewer invasive species');
INSERT INTO goals VALUES (65, 65, 'A network of green spaces', 6, '2014-02-04 16:13:09.599759', '2014-02-04 16:15:49.841409', 'A robust network of protected open spaces, farms, parks, and greenways will provide wildlife habitat, ecological benefits, recreational opportunities, and scenic beauty.');
INSERT INTO goals VALUES (47, 47, 'More walking and biking', 5, '2014-02-04 16:13:09.514193', '2014-02-04 16:15:49.91764', 'Most people will choose to walk or bike for short trips');
INSERT INTO goals VALUES (49, 49, 'Less suburban congestion', 5, '2014-02-04 16:13:09.520365', '2014-02-04 16:15:49.984293', 'Outlying areas will see little increase in traffic congestion');
INSERT INTO goals VALUES (51, 51, 'Linked transportation and planning', 5, '2014-02-04 16:13:09.529042', '2014-02-04 16:15:49.994968', 'Regional transportation planning will be linked with sustainable land use');
INSERT INTO goals VALUES (52, 52, 'Reliable funding for transportation', 5, '2014-02-04 16:13:09.532224', '2014-02-04 16:15:50.064021', 'The transportation system will be reliably funded and transportation agencies will demonstrate accountability to the public');
INSERT INTO goals VALUES (55, 55, 'Efficient transportation of freight', 5, '2014-02-04 16:13:09.566058', '2014-02-04 16:15:50.08248', 'The region''s businesses will access the global marketplace through an efficient freight transportation network');
INSERT INTO goals VALUES (13, 13, 'Suburban housing choice', 2, '2014-02-04 16:13:09.366483', '2014-02-04 16:15:50.088125', 'Families looking for suburban single-family homes will have a greater choice of smaller homes in more traditional neighborhood settings.');
INSERT INTO goals VALUES (15, 15, 'Less regional segregation', 2, '2014-02-04 16:13:09.373361', '2014-02-04 16:15:50.150525', 'There will be less regional segregation as all municipalities increasingly reflect Metro Boston’s growing diversity.');
INSERT INTO goals VALUES (17, 17, 'An end to homelessness', 2, '2014-02-04 16:13:09.379328', '2014-02-04 16:15:50.167632', 'Homelessness will be effectively eliminated from the region.  ');
INSERT INTO goals VALUES (18, 18, 'Housing choices for seniors', 2, '2014-02-04 16:13:09.381857', '2014-02-04 16:15:50.17425', 'The region’s seniors will have more housing choices and opportunities to downsize while staying in their own community.');
INSERT INTO goals VALUES (20, 20, 'Appealing urban housing options', 2, '2014-02-04 16:13:09.387207', '2014-02-04 16:15:50.2329', 'Urban neighborhoods will boast more appealing housing options for young professionals and their families');
INSERT INTO goals VALUES (33, 33, 'Competetive in the knowledge economy', 4, '2014-02-04 16:13:09.458687', '2014-02-04 16:15:50.246629', 'The region will be globally competitive in the knowledge economy.');
INSERT INTO goals VALUES (34, 34, 'Green technology leadership', 4, '2014-02-04 16:13:09.462194', '2014-02-04 16:15:50.272213', 'The region will be a national leader in the green technology and clean energy sectors, from development through manufacturing and application.');
INSERT INTO goals VALUES (36, 36, 'Consistent economic development policies', 4, '2014-02-04 16:13:09.468442', '2014-02-04 16:15:50.3127', 'Businesses will readily relocate to and expand in the region thanks to consistent and predictable economic development policies set by an informed public sector');
INSERT INTO goals VALUES (38, 38, 'Better career opportunities for minorities', 4, '2014-02-04 16:13:09.477218', '2014-02-04 16:15:50.319343', 'More minority and immigrant workers have the opportunities to advance on the career ladder, acquire assets, and build wealth');
INSERT INTO goals VALUES (41, 41, 'Engaged and sustainable corporations', 4, '2014-02-04 16:13:09.489773', '2014-02-04 16:15:50.335135', 'Corporations and Institutions will see civic engagement and sustainability as central to their own success');
INSERT INTO goals VALUES (42, 42, 'Strong agricultural economy', 4, '2014-02-04 16:13:09.494634', '2014-02-04 16:15:50.337936', 'The region''s agricultural economy will grown through a focus on sustainable farming and by bringing more locally produced foods to the market');
INSERT INTO goals VALUES (7, 7, 'Community character', 1, '2014-02-04 16:13:09.352442', '2014-02-04 16:15:50.409106', 'Cities, towns, and neighborhoods will retain their sense of uniqueness and community character.');
INSERT INTO goals VALUES (12, 12, 'Regional collaboration', 1, '2014-02-04 16:13:09.364156', '2014-02-04 16:15:50.419279', 'Communities will work together to plan for growth and share resources.');
INSERT INTO goals VALUES (3, 3, 'Brownfields revitalization', 1, '2014-02-04 16:13:09.342383', '2014-02-04 16:15:50.424765', 'Brownfields and other polluted sites will have been cleaned up and re-used for parks or development.');
INSERT INTO goals VALUES (11, 11, 'Disaster preparedness and resiliency', 1, '2014-02-04 16:13:09.361909', '2014-02-04 16:15:50.479724', 'The region will be prepared for and resilient to natural disasters and climate change.');
INSERT INTO goals VALUES (1, 1, 'Focused growth', 1, '2014-02-04 16:13:09.193431', '2014-02-04 16:15:50.485406', 'Population and job growth will be concentrated in municipalities already well served by infrastructure, with slower growth in less developed areas where infrastructure is more limited.');
INSERT INTO goals VALUES (5, 5, 'Growth near transit', 1, '2014-02-04 16:13:09.347594', '2014-02-04 16:15:50.562266', 'Most new houses and jobs will be near train stops and bus routes, and new growth will be designed to promote transit use.');
