INSERT INTO objectives VALUES (1, 'The Inner Core will capture 35% of the region''s population growth and 41% of the region''s employment growth.', 1, '2014-02-06 20:35:37.396294', '2014-02-06 20:35:37.396294', '1');
INSERT INTO objectives VALUES (2, 'Regional Urban Centers will capture 26% of the region''s population growth and 14% of the region''s employment growth.', 1, '2014-02-06 20:35:37.405406', '2014-02-06 20:35:37.405406', '2');
INSERT INTO objectives VALUES (3, 'Maturing Suburbs will capture 24% of the region''s population growth and 29% of the region''s employment growth.', 1, '2014-02-06 20:35:37.408422', '2014-02-06 20:35:37.408422', '3');
INSERT INTO objectives VALUES (4, 'Developing Suburbs will capture 16% of the region''s population growth and 16% of the region''s employment growth.', 1, '2014-02-06 20:35:37.411132', '2014-02-06 20:35:37.411132', '4');
INSERT INTO objectives VALUES (5, '60% of new commercial and industrial development in the region (measured in terms of jobs created) will occur on land that is already developed.', 2, '2014-02-06 20:35:37.414271', '2014-02-06 20:35:37.414271', '1');
INSERT INTO objectives VALUES (6, '61% of new residential development in the region (measured in terms of housing units) will occur on land that is already developed.', 2, '2014-02-06 20:35:37.4176', '2014-02-06 20:35:37.4176', '2');
INSERT INTO objectives VALUES (7, 'All existing 21E or Superfund sites will be remediated and reused by 2020', 3, '2014-02-06 20:35:37.420231', '2014-02-06 20:35:37.420231', '1');
INSERT INTO objectives VALUES (8, 'All new 21E or Superfund sites will be remediated within 10 years.', 3, '2014-02-06 20:35:37.422737', '2014-02-06 20:35:37.422737', '2');
INSERT INTO objectives VALUES (9, '67% of housing unit growth in Maturing Suburbs will be concentrated near town/village centers or commercial districts.', 4, '2014-02-06 20:35:37.425277', '2014-02-06 20:35:37.425277', '1');
INSERT INTO objectives VALUES (10, '47% of housing unit growth in Developing Suburbs will be concentrated near town/village centers or commercial districts', 4, '2014-02-06 20:35:37.42852', '2014-02-06 20:35:37.42852', '2');
INSERT INTO objectives VALUES (11, '64% of new Suburban job growth would occur near existing employment centers.', 4, '2014-02-06 20:35:37.432309', '2014-02-06 20:35:37.432309', '3');
INSERT INTO objectives VALUES (12, '25% of Suburban housing units and 6% of Suburban jobs will be in mixed-use developments.', 4, '2014-02-06 20:35:37.436579', '2014-02-06 20:35:37.436579', '4');
INSERT INTO objectives VALUES (13, '66% of new housing units regionwide will be within 1 mile of fixed-route transit service', 5, '2014-02-06 20:35:37.440307', '2014-02-06 20:35:37.440307', '1');
INSERT INTO objectives VALUES (14, '70% of new commercial and industrial development (measured in number of jobs created) will be within 1 mile of fixed-route transit service', 5, '2014-02-06 20:35:37.443555', '2014-02-06 20:35:37.443555', '2');
INSERT INTO objectives VALUES (15, '75% of new development within 1/2 mile of rapid transit will be at densities of at least 50 people/jobs per developed acre', 5, '2014-02-06 20:35:37.447572', '2014-02-06 20:35:37.447572', '3');
INSERT INTO objectives VALUES (16, '100% of the region''s municipalities will have design guidelines or form-based codes', 6, '2014-02-06 20:35:37.450411', '2014-02-06 20:35:37.450411', '1');
INSERT INTO objectives VALUES (17, '100% of the region''s municipalities will have incorporated LEED or LEED-equivalent requirements in their zoning', 6, '2014-02-06 20:35:37.453064', '2014-02-06 20:35:37.453064', '2');
INSERT INTO objectives VALUES (18, 'All new residential and commercial development will meet the requirements of LEED Certification or equivalent', 6, '2014-02-06 20:35:37.456674', '2014-02-06 20:35:37.456674', '3');
INSERT INTO objectives VALUES (19, 'In no municipality will the number of housing units grow by more than 60% from 2000-2030', 7, '2014-02-06 20:35:37.459794', '2014-02-06 20:35:37.459794', '1');
INSERT INTO objectives VALUES (20, 'The acreage of land in commercial uses will grow only 7% regionwide', 7, '2014-02-06 20:35:37.463168', '2014-02-06 20:35:37.463168', '2');
INSERT INTO objectives VALUES (21, 'Small, locally owned businesses will capture an increasing share of the region''s retail and service spending', 7, '2014-02-06 20:35:37.466365', '2014-02-06 20:35:37.466365', '3');
INSERT INTO objectives VALUES (22, 'Every municipality will have a historic resources preservation plan', 8, '2014-02-06 20:35:37.469212', '2014-02-06 20:35:37.469212', '1');
INSERT INTO objectives VALUES (23, 'There will be no loss of significant historic resources', 8, '2014-02-06 20:35:37.472159', '2014-02-06 20:35:37.472159', '2');
INSERT INTO objectives VALUES (24, 'No more then 48,000 acres of open space will be lost to development by 2030', 9, '2014-02-06 20:35:37.474972', '2014-02-06 20:35:37.474972', '1');
INSERT INTO objectives VALUES (25, 'No net loss of agricultural land by 2030', 9, '2014-02-06 20:35:37.477895', '2014-02-06 20:35:37.477895', '2');
INSERT INTO objectives VALUES (26, '66% of single-family housing on nominal lots of 1/2 acre of more in suburbs will use open space or conservation subdivision designs.', 9, '2014-02-06 20:35:37.481308', '2014-02-06 20:35:37.481308', '3');
INSERT INTO objectives VALUES (27, '100% of municipalities will have a master plan that has been created or updated in the past five years and is consistent with the regional plan.', 10, '2014-02-06 20:35:37.485582', '2014-02-06 20:35:37.485582', '1');
INSERT INTO objectives VALUES (28, '100% of municipalities will have zoning consistent with the local master plan.', 10, '2014-02-06 20:35:37.490583', '2014-02-06 20:35:37.490583', '2');
INSERT INTO objectives VALUES (29, 'Disparity between actual development patterns and the MetroFuture land use plan will steadily decrease over time by most measures', 10, '2014-02-06 20:35:37.494616', '2014-02-06 20:35:37.494616', '3');
INSERT INTO objectives VALUES (30, 'Regionwide, "as of right" development potential (in terms of housing units and commercial/industrial square footage) in designated growth areas will be equal to or greater than the regional plan''s forecasts for those areas.', 10, '2014-02-06 20:35:37.498076', '2014-02-06 20:35:37.498076', '4');
INSERT INTO objectives VALUES (31, 'All municipalities will have up-to date Pre-Disaster Mitigation Plans', 11, '2014-02-06 20:35:37.501381', '2014-02-06 20:35:37.501381', '1');
INSERT INTO objectives VALUES (32, 'All municipalities will be fully implementing their Pre-Disaster Mitigation plans', 11, '2014-02-06 20:35:37.50537', '2014-02-06 20:35:37.50537', '2');
INSERT INTO objectives VALUES (33, 'The region will have no structurally deficient dams', 11, '2014-02-06 20:35:37.510335', '2014-02-06 20:35:37.510335', '3');
INSERT INTO objectives VALUES (34, 'The region will have limited new growth in flood zones', 11, '2014-02-06 20:35:37.513822', '2014-02-06 20:35:37.513822', '4');
INSERT INTO objectives VALUES (35, 'The region will have an increasing number of inter-municipal planning efforts such as regional open space, economic development, public safety, or housing plans.', 12, '2014-02-06 20:35:37.517237', '2014-02-06 20:35:37.517237', '1');
INSERT INTO objectives VALUES (36, 'The inflation-adjusted dollar value of goods and services purchased through joint procurement will steadily increase.', 12, '2014-02-06 20:35:37.520589', '2014-02-06 20:35:37.520589', '2');
INSERT INTO objectives VALUES (37, 'There will be 100% participation of the region''s municipalities in MAPC subregions.', 12, '2014-02-06 20:35:37.523478', '2014-02-06 20:35:37.523478', '3');
INSERT INTO objectives VALUES (38, 'An increasing proportion of local tax revenues will be share through regional tax sharing.', 12, '2014-02-06 20:35:37.526321', '2014-02-06 20:35:37.526321', '4');
INSERT INTO objectives VALUES (39, 'By 2030, there will be 17,500 new suburban single-family homes less than  1,700 square feet and/or on lots 1/4 of an acre or smaller.', 13, '2014-02-06 20:35:37.529429', '2014-02-06 20:35:37.529429', '1');
INSERT INTO objectives VALUES (40, 'Average lot size for new single-family houses in suburban communities would be 0.75 acres (0.62 acres in Maturing Suburbs, and 0.79 acres in Developing Suburbs.)', 13, '2014-02-06 20:35:37.532401', '2014-02-06 20:35:37.532401', '2');
INSERT INTO objectives VALUES (41, 'The region will produce 350,000 new housing units by 2030.', 14, '2014-02-06 20:35:37.535422', '2014-02-06 20:35:37.535422', '1');
INSERT INTO objectives VALUES (42, 'The regional affordability gap will be eliminated by 2030, for households earning 80%, 100%, and 120% of area median income.', 14, '2014-02-06 20:35:37.540392', '2014-02-06 20:35:37.540392', '2');
INSERT INTO objectives VALUES (43, 'There will be an increasing number of municipalities in which local median housing costs (ownership and rental) are equal to or less than 30% of regional median income.', 14, '2014-02-06 20:35:37.543786', '2014-02-06 20:35:37.543786', '3');
INSERT INTO objectives VALUES (44, 'Ownership housing units with monthly costs less than 30% of regional monthly median income will comprise a growing share of the region''s housing stock.', 14, '2014-02-06 20:35:37.547109', '2014-02-06 20:35:37.547109', '4');
INSERT INTO objectives VALUES (45, 'Rental housing units costing less than 30% of regional median income will comprise a growing share of the region''s housing stock.', 14, '2014-02-06 20:35:37.551971', '2014-02-06 20:35:37.551971', '5');
INSERT INTO objectives VALUES (46, 'There will be 97,000 new starter homes (single-family homes <1,700 square feet; single-family attached; 2-4 family homes) by 2030', 14, '2014-02-06 20:35:37.556617', '2014-02-06 20:35:37.556617', '6');
INSERT INTO objectives VALUES (47, 'In each city and town, the gap between the Non-White proportion of municipal population and the Non-White proportion of regional population will be decreasing.', 15, '2014-02-06 20:35:37.56034', '2014-02-06 20:35:37.56034', '1');
INSERT INTO objectives VALUES (48, 'Home purchase loans will be denied at rates that increasingly reflect the regions demographics, contolling for income.', 15, '2014-02-06 20:35:37.570132', '2014-02-06 20:35:37.570132', '2');
INSERT INTO objectives VALUES (49, 'An increasing share of the region''s housing stock will be affordable  to households earning less than 80%, 50%, and 30% of area median income.', 16, '2014-02-06 20:35:37.578096', '2014-02-06 20:35:37.578096', '1');
INSERT INTO objectives VALUES (50, 'An increasing proportion - up to 10% - of each municipality''s housing stock will be deed-restricted and affordable to households earning less than 80% of area median income.', 16, '2014-02-06 20:35:37.581738', '2014-02-06 20:35:37.581738', '2');
INSERT INTO objectives VALUES (51, '66% of new deed-restricted affordable housing units will be located within 1/2 mile of fixed-route transit service.', 16, '2014-02-06 20:35:37.584967', '2014-02-06 20:35:37.584967', '3');
INSERT INTO objectives VALUES (52, 'The regionwide occupancy rate for public housing will be at least 95%.', 16, '2014-02-06 20:35:37.588116', '2014-02-06 20:35:37.588116', '4');
INSERT INTO objectives VALUES (53, 'No tenants will be evicted as a result of the expiration of affordability restrictions.', 16, '2014-02-06 20:35:37.591086', '2014-02-06 20:35:37.591086', '5');
INSERT INTO objectives VALUES (54, 'There will be no net loss of affordable units as affordability restrictions expire', 16, '2014-02-06 20:35:37.594241', '2014-02-06 20:35:37.594241', '6');
INSERT INTO objectives VALUES (55, 'There will be a decreasing waitlist for all state-aided public housing and other state-assisted rental housing, including project-based Section 8 and mobile vouchers.', 16, '2014-02-06 20:35:37.597357', '2014-02-06 20:35:37.597357', '7');
INSERT INTO objectives VALUES (56, 'The number of homeless individuals and families in the region will decrease by 90%.', 17, '2014-02-06 20:35:37.600921', '2014-02-06 20:35:37.600921', '1');
INSERT INTO objectives VALUES (57, 'Demand for Department of Housing and Community Development family shelter inventory will be no more than 400 units statewide.', 17, '2014-02-06 20:35:37.604534', '2014-02-06 20:35:37.604534', '2');
INSERT INTO objectives VALUES (58, 'Demand for Department of Housing and Community Development individual shelter inventory will be no more than 250 units statewide.', 17, '2014-02-06 20:35:37.607658', '2014-02-06 20:35:37.607658', '3');
INSERT INTO objectives VALUES (59, 'Average length of shelter stays would be no more than 30 days for both individuals and families.', 17, '2014-02-06 20:35:37.611348', '2014-02-06 20:35:37.611348', '4');
INSERT INTO objectives VALUES (60, 'Fewer families and individuals will have repeated periods of homelessness.', 17, '2014-02-06 20:35:37.620786', '2014-02-06 20:35:37.620786', '5');
INSERT INTO objectives VALUES (61, 'There will be 17,000 new accessory apartments in suburban municipalities by 2030.', 18, '2014-02-06 20:35:37.627077', '2014-02-06 20:35:37.627077', '1');
INSERT INTO objectives VALUES (62, 'A declining proportion of seniors will spend over 30% of their household income on housing costs; and non will pay over 50%.', 18, '2014-02-06 20:35:37.631479', '2014-02-06 20:35:37.631479', '2');
INSERT INTO objectives VALUES (63, '76% of new suburban housing units will be in attached single-family or multifamily buildings.', 18, '2014-02-06 20:35:37.64075', '2014-02-06 20:35:37.64075', '3');
INSERT INTO objectives VALUES (64, 'All new construction will be built in full compliance with state and federal accessibility rules, regulations, and standards.', 19, '2014-02-06 20:35:37.645303', '2014-02-06 20:35:37.645303', '1');
