INSERT INTO objectives VALUES (183, 'By 2030, 100% of the region''s cities and towns will recycle or compost 56% of municipal solid waste', 58, '2014-02-06 20:35:38.168279', '2014-02-06 20:35:38.168279', '2');
INSERT INTO objectives VALUES (184, 'By 2030, the region will purchase from renewable sources (without increases in nuclear, large hydroelectric, and biofuels) electricity equivalent to 25% of year 2000 electricity demand.', 59, '2014-02-06 20:35:38.175121', '2014-02-06 20:35:38.175121', '1');
INSERT INTO objectives VALUES (185, 'The region will build at least 400 MW of clean energy capacity in the MAPC regions', 59, '2014-02-06 20:35:38.180838', '2014-02-06 20:35:38.180838', '2');
INSERT INTO objectives VALUES (186, 'Regional ozone (smog)-O2 levels will never exceed 0.070 ppm (8 hour average)', 60, '2014-02-06 20:35:38.184435', '2014-02-06 20:35:38.184435', '1');
INSERT INTO objectives VALUES (187, 'Sensitive land uses (homes, schools, daycare, playgrounds, or medical facilities, etc. ) will not be sited closer than 500 ft to a major transportation facility (freeways or urban roadway within 50,000 vehicles or more per day)', 60, '2014-02-06 20:35:38.187583', '2014-02-06 20:35:38.187583', '2');
INSERT INTO objectives VALUES (188, 'There will be no areas in the region that have ambient PM 2.5 level higher than 10 micrograms per cubic meter on an annual basis', 60, '2014-02-06 20:35:38.191986', '2014-02-06 20:35:38.191986', '3');
INSERT INTO objectives VALUES (189, 'Total demand for public water systems will decline by 12%', 61, '2014-02-06 20:35:38.197713', '2014-02-06 20:35:38.197713', '1');
INSERT INTO objectives VALUES (190, 'Per capita residential water consumption will decline by 20%', 61, '2014-02-06 20:35:38.200571', '2014-02-06 20:35:38.200571', '2');
INSERT INTO objectives VALUES (191, 'Average water demand for all new residential development will be no more than 50 gallons per person per day', 61, '2014-02-06 20:35:38.230238', '2014-02-06 20:35:38.230238', '3');
INSERT INTO objectives VALUES (192, 'In 100% of public water systems, peak month water demand will be no more than 125% of average annual demand', 61, '2014-02-06 20:35:38.236089', '2014-02-06 20:35:38.236089', '4');
INSERT INTO objectives VALUES (193, '100% of public water supplies have unaccounted for water less than 10%', 61, '2014-02-06 20:35:38.23907', '2014-02-06 20:35:38.23907', '5');
INSERT INTO objectives VALUES (194, 'The volume of interbasin transfers (via water or wastewater) out of medium of high-stress basins will steadily decline)', 61, '2014-02-06 20:35:38.241522', '2014-02-06 20:35:38.241522', '6');
INSERT INTO objectives VALUES (195, 'Fewer of the region''s waterways will be impaired due to pollution', 62, '2014-02-06 20:35:38.244091', '2014-02-06 20:35:38.244091', '1');
INSERT INTO objectives VALUES (196, '100% of combined sewer lines in the region will be separated and 100% of CSO outfall points will be closed', 62, '2014-02-06 20:35:38.247278', '2014-02-06 20:35:38.247278', '1');
INSERT INTO objectives VALUES (197, 'Stream flow levels measured by USGS gauges will be comparable to historical stream flow', 62, '2014-02-06 20:35:38.249997', '2014-02-06 20:35:38.249997', '2');
INSERT INTO objectives VALUES (198, 'There will be zero violations of safe swimming standards in the region''s rivers, lakes and beaches.', 62, '2014-02-06 20:35:38.252487', '2014-02-06 20:35:38.252487', '3');
INSERT INTO objectives VALUES (199, 'The region will have no more than 18,000 acres of new impervious surface.', 62, '2014-02-06 20:35:38.254876', '2014-02-06 20:35:38.254876', '4');
INSERT INTO objectives VALUES (200, 'There will be no net loss of wetland acreage', 63, '2014-02-06 20:35:38.257535', '2014-02-06 20:35:38.257535', '1');
INSERT INTO objectives VALUES (201, 'Residential development will result in the loss of no more than 6,000 acres of land in Areas of Critical Environmental Concern.', 64, '2014-02-06 20:35:38.261354', '2014-02-06 20:35:38.261354', '1');
INSERT INTO objectives VALUES (202, 'There will be no loss of core habitat for rare and endangered species', 64, '2014-02-06 20:35:38.265166', '2014-02-06 20:35:38.265166', '2');
INSERT INTO objectives VALUES (203, '139,000 acres of developable land identified as a high priority by the State Land Conservation Plan will be permanently protected from development', 65, '2014-02-06 20:35:38.269008', '2014-02-06 20:35:38.269008', '1');
INSERT INTO objectives VALUES (204, 'No more than 5,000 acres of prime and important farmland soils will be lost to development', 65, '2014-02-06 20:35:38.272496', '2014-02-06 20:35:38.272496', '2');
